import React, { useEffect, useState } from 'react'
import axios from 'axios'

function FiveDayForecastTest() {

    const [users, setUsers] = useState([])

useEffect(() => {
axios.get('https://jsonplaceholder.typicode.com/users')
    //response.list.filter(reading => reading.dt_txt.includes("18:00:00"))))
    .then(response => {
        setUsers(response.data.filter(reading => reading.phone.includes("736")))
    })
    .catch(err => {
        console.log(err.message);
    });
})

    return (
        <div>
            <ul>
                {users.map(user => (
                    <li key={user.id}>{user.email} and suits {user.address.suite} </li>
                ))}
            </ul>

        </div>
    )
}

export default FiveDayForecastTest
